import React from 'react';
import Book from "./ui/components/books/Book/Book.jsx";
import Books from "./ui/components/books/Books/Books.jsx";
import {Container} from "@mui/material";

const App = () => {
  const books = [
    {
      "name": "Book1",
      "category": 'NOVEL',
    },
    {
      "name": "Book2",
      "category": 'NOVEL',
    },
    {
      "name": "Book3",
      "category": 'NOVEL',
    },
    {
      "name": "Book4",
      "category": 'NOVEL',
    },
    {
      "name": "Book5",
      "category": 'NOVEL',
    },
    {
      "name": "Book6",
      "category": 'NOVEL',
    },
    {
      "name": "Book7",
      "category": 'NOVEL',
    },
    {
      "name": "Book8",
      "category": 'NOVEL',
    },
    {
      "name": "Book9",
      "category": 'NOVEL',
    },
  ];
  return (
      <Container maxWidth="lg">
        <Books books={books}/>
      </Container>
  );
};


export default App
